import React from "react";
import Grid from "../elements/Grid";
import Image from "../elements/Image";
const Post = (props) => {
  return (
    <React.Fragment>
      <Grid padding="16px">
        <Grid is_flex>
          <Image shape="circle" src={props.src} />
        </Grid>
        <Grid>
          <Image shape="rectangle" />
        </Grid>
        <Grid padding="16px"></Grid>
        <Grid padding="16px"></Grid>
        <div> user profle/ user name / inser_dt / is_me (edit btn)</div>
        <div>contents</div>
        <div>images</div>
        <div>comment cnt</div>
      </Grid>
    </React.Fragment>
  );
};

Post.defaultProps = {
  user_info: {
    user_name: "bong",
    user_profile:
      "https://idsb.tmgrup.com.tr/ly/uploads/images/2021/09/08/thumbs/800x531/142774.jpg",
  },
  image_url:
    "https://idsb.tmgrup.com.tr/ly/uploads/images/2021/09/08/thumbs/800x531/142774.jpg",
  contents: "고양이네요!",
  comment_cnt: 10,
  insert_dt: "2022-02-04 14:32:00",
};

export default Post;
